import React, {Component} from 'react';
import Noticia from './Noticia';

class Noticias extends Component{
  render() {
    return (
          <div className = "row">
            {this.props.noticias.map(noticia =>(
              <Noticia
                  noticia = {noticia}
              />
            ))}
          </div>
    )
  }
}

export default Noticias;
